const LoginPage = () => {
  const handleLogin = () => {
    window.location.href = "http://localhost:5001/api/auth/login";
  };

  return (
    <div className="login-page">
      <h1>Login to Spotify</h1>
      <button className="login-button" onClick={handleLogin}>
        Login with Spotify
      </button>
    </div>
  );
};

export default LoginPage;
